import { Fragment } from "react";
import Icon from '../../assets/Images/delivery.png';

const Cart = (props) => {
  return <Fragment>
    <img src="../../assets/Images/delivery.png" alt="delivery-icon" />
    <span>Cart</span>
    <span>0</span>
  </Fragment>;
};

export default Cart;
